import {BrowserRouter as Router, Route, Routes} from 'react-router-dom';
import Foodlist from './Foodlist';

function App() {
  return (
    <Router>
        <div className="App">
      <header className="App-header">
      <h>Welcome to burger hub</h>
      </header>
      <Foodlist />
    </div>
    </Router>

  );
}

export default App;
